const axios = require('axios');
const request = axios.create({
  baseURL: "https://api.github.com",
})

request.interceptors.response.use(function (response) {
  // 对响应数据做点什么
  return response;
}, function (err) {
  console.log(err)
  if (err && err.response) {
    switch (err.response.status) {
      case 400: err.message = '请求错误(400)'; break;
      case 401: err.message = '未授权，请重新登录(401)'; break;
      case 403: err.message = '拒绝访问(403)'; break;
      case 404: err.message = '请求出错(404)'; break;
      case 408: err.message = '请求超时(408)'; break;
      case 500: err.message = '服务器错误(500)'; break;
      case 501: err.message = '服务未实现(501)'; break;
      case 502: err.message = '网络错误(502)'; break;
      case 503: err.message = '服务不可用(503)'; break;
      case 504: err.message = '网络超时(504)'; break;
      case 505: err.message = 'HTTP版本不受支持(505)'; break;
      default: err.message = `连接出错(${err.response.status})!`;
    }
  } else {
    err.message = '连接服务器失败!'
  }
  return {
    data: null
  };
});

const githubUsername = "GitHub-Laziji"

module.exports = function (api) {
  // 导入配置信息
  api.loadSource(async actions => {
    const config = require('./config/configuration.json');
    const collection = actions.addCollection({
      typeName: 'BlogConfig'
    })
    collection.addNode(config);
  })
  // 导入路由信息
  api.loadSource(async actions => {
    const router = require('./config/router.json');
    const collection = actions.addCollection({
      typeName: 'BlogRouter'
    })
    router.reverse();
    for (let item of router) {
      collection.addNode(item);
    }
  })
  // 导入用户信息
  api.loadSource(async actions => {
    const { data } = await request({ url: '/users/' + githubUsername });
    if (!data) {
      return
    }
    const collection = actions.addCollection({
      typeName: 'User'
    })
    collection.addNode(Object.assign(data, { userId: data.id, id: githubUsername }));
  })
  // 导入最新动态信息
  api.loadSource(async actions => {
    // const { data } = await request({ url: '/users/' + githubUsername + "/gists?page=1&per_page=1" });
    // if (!data) {
    //   return
    // }
    // const { data: newGists } = await request({ url: `/gists/${data[0].id}` });
    let blog = {}, gistData = GIST_DATA;
    for (let key in gistData.files) {
      blog.content = gistData.files[key].content;
      blog.title = key;
    }
    blog.created_at = gistData.created_at;
    blog.updated_at = gistData.updated_at;
    blog.description = gistData.description;
    blog.id = '-1';
    const collection = actions.addCollection({
      typeName: 'New'
    })
    collection.addNode(blog);
  })
  // 导入博文信息
  api.loadSource(async actions => {
    const collection = actions.addCollection({
      typeName: 'Gist'
    });
    const result = [];
    const func = async (page) => {
      const { data } = await request({ url: `/users/${githubUsername}/gists?page=${page}&per_page=100` });
      if (!data) {
        return
      }
      for (let item of data) {
        let blog = {}, gistData = GIST_DATA;;
        for (let key in gistData.files) {
          blog.content = gistData.files[key].content;
        }
        for (let key in item.files) {
          blog.title = key;
        }
        blog.created_at = item.created_at;
        blog.updated_at = item.updated_at;
        blog.description = item.description;
        blog.id = item.id;
        result.push(blog);
      }
      if (data.length === 100) {
        await func(page + 1)
      }
    }
    await func(1);
    result.reverse();
    for(let blog of result){
      collection.addNode(blog);
    }
  })
  // 导入用户粉丝的信息
  api.loadSource(async actions => {
    const collection = actions.addCollection({
      typeName: 'UserFollowers'
    })
    let userCollection = actions.getCollection('User');
    const result = [];
    const func = async (page) => {
      const { data } = await request({ url: `/users/${githubUsername}/followers?page=${page}&per_page=100` });
      if (!data) {
        return
      }
      for (let item of data) {
        result.push(item)
        // 接口太卡，使用假数据
        // const { data: userData } = await request({ url: '/users/' + item.login });
        // if (!userData) {
        //   return
        // }
        let userData = USER_DATA;
        userCollection.addNode(Object.assign(userData, item, { userId: userData.id, id: item.login }));
      }
      if (data.length === 100) {
        await func(page + 1)
      }
    }
    await func(1);
    result.reverse();
    for(let item of result){
      collection.addNode(item);
    }
  })
  // 导入用户关注的信息
  api.loadSource(async actions => {
    const collection = actions.addCollection({
      typeName: 'UserFollowing'
    })
    let userCollection = actions.getCollection('User');
    const result = [];
    const func = async (page) => {
      const { data } = await request({ url: `/users/${githubUsername}/following?page=${page}&per_page=100` });
      if (!data) {
        return
      }
      for (let item of data) {
        result.push(item)
        // 接口太卡，使用假数据
        // const { data: userData } = await request({ url: '/users/' + item.login });
        let userData = USER_DATA;
        userCollection.addNode(Object.assign(userData, item, { userId: userData.id, id: item.login }));
      }
      if (data.length === 100) {
        await func(page + 1)
      }
    }
    await func(1);
    result.reverse();
    for(let item of result){
      collection.addNode(item);
    }
  })
  // 导入项目信息
  api.loadSource(async actions => {
    const { data } = await request({ url: `/users/${githubUsername}/repos` });
    if (!data) {
      return
    }
    const collection = actions.addCollection({
      typeName: 'Project'
    });
    const result = [];
    for (let item of data) {
      let url = '/repos/' + githubUsername + '/' + item.name + '/contents/README.md'
      // 接口太卡，使用假数据
      result.push(Object.assign(item, {
        readme_content: item.name + url
      }));
      // try {
      //   let { data } = await request({ url });
      //   result.push(Object.assign(item, {
      //     readme_content: require('js-base64').Base64.decode(data.content)
      //   }))
      // } catch (e) {
      //   result.push(Object.assign(item, {
      //     readme_content: ''
      //   }))
      // }
    }
    result.reverse();
    for (let project of result) {
      collection.addNode(project);
    }
  })
  // 导入README 
  api.loadSource(async actions => {
    const { data } = await request({
      url: '/repos/' + githubUsername + '/' + githubUsername + '.github.io/contents/README.md'
    });
    if (!data) {
      return
    }
    const collection = actions.addCollection({
      typeName: 'Readme'
    });
    collection.addNode({ text: require('js-base64').Base64.decode(data.content), id: 0 });
  })
  api.createPages(({ createPage }) => {
    // Use the Pages API here: https://gridsome.org/docs/pages-api/
  })
}
